import React from "react";
import {
  View,
  TextInput,
  StyleSheet,
  TouchableOpacity,
} from "react-native";

export default function SearchBar(props) {
  return (
    <View style={styles.container}>
      <Tex tInput style={styles.searchInp} placeholder="Search products..." />
      <View>
        <TouchableOpacity  title="X"></TouchableOpacity>
        <TouchableOpacity style={styles.buttons} title="S"></TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    margin: 10,
  },
  searchInp: {
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 10,
    paddingHorizontal: 10,
    paddingVertical: 5,
  },
  buttons: {
    alignSelf: "flex-end",
    textAlign: "right",
  },
});
